import { StreamBarcodeReader } from "vue-barcode-reader";

<template>
    <div>
        <div class="wrap">

            <!-- ======== 카테고리 헤더 ======== -->
            <div class="header">
                <div class="main_logo" v-on:click="goHome"></div>
                <div class="header_title">
                    <div class="header_title_down">보관함 열림</div>    
                </div>
                <div class="back"  v-on:click="goBack"></div>    
            </div>

            <!-- ======== 내용 ======== -->
            <div class="boxopen_container">
                <div class="boxopen_area">
                </div>
                <div class="boxopen_ment">
                </div>
            </div><!--container끝-->

            <div class="tail"  v-on:click="goBoxClose">
            </div>
        </div><!--wrap 끝-->

    </div>
</template>
<script>
import '@/assets/css/receipt/boxopen.css';

import axios from 'axios';
//import dayjs from "dayjs"
//const nowDay_json = "@/assets/json/" + dayjs().format('YYYY-MM-DD') + ".json";
//import json_day_log from nowDay_json;

export default {
    name: "BoxOpen",
    data() {
        return {
            filter: "All",
            request_data :{nmDistrNo:'',regino:'',file:''}   
                            // 무인교부기번호7, 등기번호13, 싸인파일         
        };
    },
    methods: {
        goBack(){
            this.$router.go(-1);
        },
        goHome(){
            this.$router.push('/');
        },
        goBoxClose(){
            this.$router.push('/receiptboxclose');
        },
        // 등기수취완료
        postRegiNo() {
            axios.post("https://postnet.co.kr/saveRegNmDistrRegiMail.jsp", this.request_data, {
                header: {
                    "Context-Type": "multipart/form-data",
                },
            })
            .then((res) => { // 성공했을 경우
                console.log("성공", res);
                // statusCd : 등기투입결과 - 1 - S성공,F실패

            })
            .catch((res) => { // 실패했을 경우
                console.error("실패 ", res);
            });
        }

    },
    created() {
            this.log_data.postNo = '1111101';
            this.log_data.boxNo = '';
            this.log_data.userId = '';
            this.log_data.menuName = '[메뉴]서명확인';
            this.log_data.actionData = '서명';
            // 로그처리
            axios.post("http://localhost:8910/admin/dispenserlog/create", this.log_data, {
                header: {
                    "Context-Type": "multipart/form-data",
                },
            })
            .then((res) => { // 성공했을 경우
                console.log("성공", res);

            })
            .catch((res) => { // 실패했을 경우
                console.error("실패 ", res);
            });
    },
    mounted() {
    }

};
</script>
